Insert into LANCER_RESUME (UUID,TAGLINE,LANCER_ID,VIDEO,HOURLY_RATE,CHARGE_RATE,VIDEO_URL,OVERVIEW,KEYWORDS,CREATE_BY,CREATE_ON,MODIFY_BY,MODIFY_ON,VERSION) values ('c0d5b7a060b6448fa8bb68a3c1b3ee28','这是tagLine','muhongdi',null,101,102.13,null,'“白日依山尽，黄河入海流”，写的是登楼望见的景色，写得景象壮阔，气势雄浑。这里，诗人运用极其朴素、极其浅显的语言，既高度形象又高度概括地把进入广大视野的万里河山，收入短短十个字中；而我们在千载之下读到这十个字时，也如临其地，如见其景，感到胸襟为之一开。首句 “白日依山尽“，写遥望一轮落日向着楼前一望无际、连绵起伏的群山西沉，在视野的尽头冉冉而没。这是天空景、远方景、西望景。次句 ”黄河入海流”，目送流经楼前下方的黄河奔腾咆哮、滚滚南来，又在远处折而东向，流归大海。这是由地面望到天边，由近望到远，由西望到东。这两句诗合起来，"白日依山尽，黄河入海流"，就把上下、远近、东西的景物，全都容纳进诗笔之下，使画面显得特别宽广，特别辽远。就次句诗而言，诗人身在鹳雀楼上，不可能望见黄河入海，句中写的是诗人目送黄河远去天边而产生的意中景，是把当前景与意中景溶合为一的写法。这样写，更增加了画面','专家,Test，replace中文逗号为英文逗号',null,null,null,null,null);
Insert into LANCER_RESUME (UUID,TAGLINE,LANCER_ID,VIDEO,HOURLY_RATE,CHARGE_RATE,VIDEO_URL,OVERVIEW,KEYWORDS,CREATE_BY,CREATE_ON,MODIFY_BY,MODIFY_ON,VERSION) values ('531ca069aa0e41aea7c114cf11cb7be6','这是tagLine','muhongdi',null,101,102.13,null,'Singapore may be small, but packs in quite a punch. Only about 655 square kilometers in area, it is one of the most densely populated cities in the world, with about 6430 people per square kilometer. Although it is one of the 20 smallest countries in the world, its economy is a world leader, and has the world''s busiest port in terms of tonnage handled. 
